import React, {useState} from "react";

const App = () =>{
    const [count, setCount] = useState(1);

    const handelUpdate = () =>{
        setCount(count+1);
    }
    return(
        <>
        <button onClick={handelUpdate}>Update</button>
        <p>count: {count}</p>
        </>
    );
}

export default App;
